             aura_env.count = 0\
             aura_env.list = {}\
             aura_env.marks = {}\
             aura_env.units = {}\
             aura_env.me = 0\
             aura_env.mygroup = 0\
             local note = NSAPI:GetNote()\
             local list = false\
             if note == \"\" then return end\
             for line in note:gmatch('[^\\r\\n]+') do\
